import React, { useState } from 'react';
import { Container, Box, Grid, TextField, Button } from '@mui/material';
import ResponsiveAppBar from './ResponsiveAppBar';
import GlassDiv from './GlassDiv';
import SignInForm from './SignInForm';

function JoinNowForm() {
  return (
    <form style={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      width: '100%',
      height: '100%',
    }}>
      <TextField label="Username" variant="outlined" />
      <TextField label="Password" variant="outlined" type="password" />
      <Button variant="contained" color="primary">Join Now</Button>
    </form>
  );
}

export default function Home() {
  const [joinNowBtnTrigger, setJoinNowBtnTrigger] = useState(false);

  const handleJoinNowClick = () => {
    setJoinNowBtnTrigger(true);
  };

  return (
    <>
      {joinNowBtnTrigger && (
        <GlassDiv>
          <JoinNowForm />
        </GlassDiv>
      )}
      <Container maxWidth="xl" sx={{ pt: '10px' }}>
        <Box sx={{ width: '80%', mx: 'auto', flexGrow: 1 }}>
          <Grid container spacing={1}>
            <Grid item xs={12} md={12}>
              <ResponsiveAppBar JoinNowCallBack={handleJoinNowClick} />
            </Grid>
            <Grid item xs={12} md={12}>
              <SignInForm />
            </Grid>
          </Grid>
        </Box>
      </Container>
    </>
  );
}
